import "./style.css";

const devData = [
  { name: "John", age: 23, status: "Junior" },
  { name: "Murray", age: 30, status: "Senior" },
  { name: "Molly", age: 28, status: "Mid-Level" },
];

const App = () => {
  const [user, setUser] = React.useState(devData);
  return (
    <div className="body">
      <h1>Our Developers</h1>
      {devData.map((dev) => {
        return (
          <div className="devs">
            <h3>{dev.status} Developer</h3>
            <div></div>
          </div>
        );
      })}
    </div>
  );
};

export default App;
